import React  from "react";
import Header from "../partials/Header";

export default function HistoryHospital(){
    return(
        <>
        <Header />
        <div className="maincontainer">
            <table>
                <th>
                    <td>Name</td>
                    <td>Date</td>
                    <td></td>
                </th>
            </table>
        </div>
        </>
    )
}
